-- --------------------------------------------------------
-- comunas
-- --------------------------------------------------------

CREATE TABLE public.comunas (
    id integer NOT NULL,
    area real NOT NULL,
    perimetro real NOT NULL,
    listado_barrios character varying NOT NULL
);


ALTER TABLE ONLY public.comunas
    ADD CONSTRAINT "Comuna_pkey" PRIMARY KEY (id);



-- --------------------------------------------------------
-- barrios
-- --------------------------------------------------------

CREATE TABLE public.barrios (
    nombre character varying NOT NULL,
    area real NOT NULL,
    perimetro real NOT NULL,
    comuna integer NOT NULL
);


ALTER TABLE ONLY public.barrios
    ADD CONSTRAINT "Barrio_pkey" PRIMARY KEY (nombre);

ALTER TABLE ONLY public.barrios
    ADD CONSTRAINT "Barrio_comuna_fkey" FOREIGN KEY (comuna) REFERENCES public.comunas(id);



-- --------------------------------------------------------
-- bancos
-- --------------------------------------------------------

CREATE TABLE public.bancos (
    id integer NOT NULL,
    nombre character varying NOT NULL
);


ALTER TABLE ONLY public.bancos
    ADD CONSTRAINT banco_pkey PRIMARY KEY (id);

ALTER TABLE ONLY public.bancos
    ADD CONSTRAINT nombre_unique UNIQUE (nombre);



-- --------------------------------------------------------
-- cajeros_automaticos
-- --------------------------------------------------------

CREATE TABLE public.cajeros_automaticos (
    id integer NOT NULL,
    banco character varying NOT NULL,
    red character varying NOT NULL,
    terminales integer NOT NULL,
    calle character varying,
    altura integer,
    barrio character varying,
    comuna integer
);


ALTER TABLE ONLY public.cajeros_automaticos
    ADD CONSTRAINT "cajeros_automaticos_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY public.cajeros_automaticos
    ADD CONSTRAINT banco_fkey FOREIGN KEY (banco) REFERENCES public.bancos(nombre);

ALTER TABLE ONLY public.cajeros_automaticos
    ADD CONSTRAINT barrio_fkey FOREIGN KEY (barrio) REFERENCES public.barrios(nombre);

ALTER TABLE ONLY public.cajeros_automaticos
    ADD CONSTRAINT comuna_fkey FOREIGN KEY (comuna) REFERENCES public.comunas(id);



-- --------------------------------------------------------
-- gimnasios
-- --------------------------------------------------------

CREATE TABLE public.gimnasios (
    id integer NOT NULL,
    razon_social character varying NOT NULL,
    nombre character varying NOT NULL,
    clasificacion character varying NOT NULL,
    telefono character varying,
    calle character varying NOT NULL,
    altura integer NOT NULL,
    piso character varying,
    barrio character varying,
    comuna integer
);


ALTER TABLE ONLY public.gimnasios
    ADD CONSTRAINT "public.gimnasios_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY public.gimnasios
    ADD CONSTRAINT barrio_fkey FOREIGN KEY (barrio) REFERENCES public.barrios(nombre);

ALTER TABLE ONLY public.gimnasios
    ADD CONSTRAINT comuna_fkey FOREIGN KEY (comuna) REFERENCES public.comunas(id);
